import {
  ecfToLookAngles,
  propagate,
  gstime,
  twoline2satrec,
  eciToEcf,
  eciToGeodetic,
  degreesLong,
  degreesLat
} from "satellite.js";

///////////////////////////////////////////////////////////////
/////////    Satellite/Rotator Object Constructors     ////////
///////////////////////////////////////////////////////////////
export async function getSatellite(satelliteName) {
  // retrieve orbital data from Celestrak
  const OMM = await fetchOrbitalData(satelliteName, "JSON");
  const TLE = await fetchOrbitalData(satelliteName, "TLE");
  const satRec = getSatRec(TLE);
  const positionGd = getPositionGd(satRec);

  // create popup template
  const temp = {
    title: "{Name}",
    content: [
      {
        type: "fields",
        fieldInfos: [
          {
            fieldName: "Longitude",
            label: "Longitude",
            format: {
              digitSeparator: true,
              places: 0
            }
          },
          {
            fieldName: "Latitude",
            label: "Latitude",
            format: {
              digitSeparator: true,
              places: 0
            }
          },
          {
            fieldName: "Altitude",
            label: "Altitude",
            format: {
              digitSeparator: true,
              places: 0
            }
          },
          {
            fieldName: "Time",
            label: "Time (UTC)",
            format: {
              digitSeparator: true,
              places: 0
            }
          }
        ]
      }
    ]
  };

  //Construct satellite object
  const satellite = {
    Name: satelliteName,
    Time: getTimeUTC(positionGd),
    Longitude: degreesLong(positionGd.longitude),
    Latitude: degreesLat(positionGd.latitude),
    Altitude: positionGd.height,
    SatRec: satRec,
    Omm: OMM,
    Template: temp
  };

  return satellite;
}

export async function getRotator(IP) {
  if (isValid(IP)) {
    // retrieve rotator data
    const connectResponse = await fetchJson(IP, "Connect");
    if (connectResponse !== undefined) {
      // create popup template
      const temp = {
        title: "Observer: {Call_Sign}",
        content: [
          {
            type: "fields",
            fieldInfos: [
              {
                fieldName: "Longitude",
                label: "Longitude",
                format: {
                  digitSeparator: true,
                  places: 0
                }
              },
              {
                fieldName: "Latitude",
                label: "Latitude",
                format: {
                  digitSeparator: true,
                  places: 0
                }
              },
              {
                fieldName: "Model",
                label: "Model",
                format: {
                  digitSeparator: true,
                  places: 0
                }
              },
              {
                fieldName: "isTracking",
                label: "Tracking",
